import React from 'react'

const Footer = () => {
  return (
    <div className='bg-dark text-light'>
     <div className="container">
      <div className="row">
        <img src="logo-2.jpg" alt="logo" style={{size:'1px'}} />
      </div>
     </div>
    </div>
  )
}

export default Footer
